import React, { useState, useEffect } from 'react';
import check from '../Axios/LoginCheckAxios';
import { Link } from 'react-router-dom';
import styled from 'styled-components';

function LoginCheck() {

    const [userName, setUserName] = useState('');

    function callback(data){
     setUserName(data);
    }

    useEffect(
        () => {
              check(callback);
        }, []
    )
        return (
            <>
            <NavItem><Link to='/login' style={{ textDecoration: 'none' ,color:'black'  ,fontFamily: ' sanserif'}}>Login</Link></NavItem> 
            <NavItem><Link to='/join' style={{ textDecoration: 'none' ,color:'black'  ,fontFamily: 'sanserif'}}>Join</Link></NavItem>    
            </>
        );
  
}

export default LoginCheck;
